import React, {useState} from "react";

const Counter = () => {
  const [txtVal, setTxtValue] = useState("");

  const onChange = () => {
    setTxtValue(e.target.value);
  };

  return (
    <div>
      <input type="text" value={txtVal} onChange={onChange} />
      <br />
      <p>{txtVal}</p>    
    </div>
  )
}

export default Counter;
